import React from 'react'
import { Home } from 'lucide-react';
function Sidebar() {
  return (
    <div className= 'bg-[#1c1b23] sidebar overflow-scroll md:m-[1rem] m-[0.2rem] h-[95vh] md:w-[20vw] '>
      <div>
         <p className='flex text-[#818086]' ><Home color="white" />Home</p>
         <p className='flex text-white' ><Home color="white" />Videos</p>
         <p className='text-white'>Socials</p>
      </div>
    </div>
  )
}

export default Sidebar
